sections:
  - name: AppExpert.Stringmaps
    elements:
      - name: PSM_TENANT
        references:
          - PLH_PSM_TENANT
        expressions:
          install: add policy stringmap PLH_PSM_TENANT
          uninstall: rm policy stringmap PLH_PSM_TENANT
      - name: PSM_ENDPOINT
        references:
          - PLH_PSM_ENDPOINT
        expressions:
          install: add policy stringmap PLH_PSM_ENDPOINT
          uninstall: rm policy stringmap PLH_PSM_ENDPOINT
      - name: PSM_FQDN
        references:
          - PLH_PSM_FQDN
        expressions:
          install: add policy stringmap PLH_PSM_FQDN
          uninstall: rm policy stringmap PLH_PSM_FQDN
      - name: PSM_CS
        references:
          - PLH_PSM_CS
        expressions:
          install: add policy stringmap PLH_PSM_CS
          uninstall: rm policy stringmap PLH_PSM_CS
      - name: PSM_CSGROUP
        references:
          - PLH_PSM_CSGROUP
        expressions:
          install: add policy stringmap PLH_PSM_CSGROUP
          uninstall: rm policy stringmap PLH_PSM_CSGROUP
      - name: PSM_IPFILTER_CS
        references:
          - PLH_PSM_IPFILTER_CS
        expressions:
          install: add policy stringmap PLH_PSM_IPFILTER_CS
          uninstall: rm policy stringmap PLH_PSM_IPFILTER_CS
      - name: PSM_IPFILTER_CSGROUP
        references:
          - PLH_PSM_IPFILTER_CSGROUP
        expressions:
          install: add policy stringmap PLH_PSM_IPFILTER_CSGROUP
          uninstall: rm policy stringmap PLH_PSM_IPFILTER_CSGROUP
      - name: PSM_IPFILTER_TENANT
        references:
          - PLH_PSM_IPFILTER_TENANT
        expressions:
          install: add policy stringmap PLH_PSM_IPFILTER_TENANT
          uninstall: rm policy stringmap PLH_PSM_IPFILTER_TENANT
        

  - name: TrafficManagement.LoadBalancing.ServiceGroups
    elements:
      - name: SVG_DUMMY_HTTP
        references:
          - PLH_SVG_DUMMY_HTTP
          - PLH_SRV_DUMMY
        dependencies:
          - SRV_DUMMY
        expressions:
          install: |
            add serviceGroup PLH_SVG_DUMMY_HTTP HTTP -healthMonitor NO
            bind serviceGroup PLH_SVG_DUMMY_HTTP PLH_SRV_DUMMY *
          uninstall: |
            unbind serviceGroup PLH_SVG_DUMMY_HTTP PLH_SRV_DUMMY *
            rm serviceGroup PLH_SVG_DUMMY_HTTP
      - name: SVG_DUMMY_TCP
        references:
          - PLH_SVG_DUMMY_TCP
          - PLH_SRV_DUMMY
        dependencies:
          - SRV_DUMMY
        expressions:
          install: |
            add serviceGroup PLH_SVG_DUMMY_TCP TCP -healthMonitor NO
            bind serviceGroup PLH_SVG_DUMMY_TCP PLH_SRV_DUMMY *
          uninstall: |
            unbind serviceGroup PLH_SVG_DUMMY_TCP PLH_SRV_DUMMY *
            rm serviceGroup PLH_SVG_DUMMY_TCP
      - name: SVG_DUMMY_UDP
        references:
          - PLH_SVG_DUMMY_UDP
          - PLH_SRV_DUMMY
        dependencies:
          - SRV_DUMMY
        expressions:
          install: |
            add serviceGroup PLH_SVG_DUMMY_UDP UDP -healthMonitor NO
            bind serviceGroup PLH_SVG_DUMMY_UDP PLH_SRV_DUMMY *
          uninstall: |
            unbind serviceGroup PLH_SVG_DUMMY_UDP PLH_SRV_DUMMY *
            rm serviceGroup PLH_SVG_DUMMY_UDP

  - name: TrafficManagement.LoadBalancing.Servers
    elements:
      - name: SRV_DUMMY
        references:
          - PLH_SRV_DUMMY
        expressions:
          install: |
            add dns addRec _V_-dummy 169.254.0.1 -TTL 300
            add server PLH_SRV_DUMMY _V_-dummy
          uninstall: |
            rm server PLH_SRV_DUMMY
            rm dns addRec _V_-dummy